import React , {useState , useEffect} from 'react'

function Workers() {
    const[data,setData] = useState([{}])

    useEffect(() => {
        fetch("/workers").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
    )
    },[]

    )
    return (
        <div className='workers'>
            <h1>Workers </h1>

            {(typeof data.members === 'string')?(
                <p>Loading ...</p>
            ): (
                data.members.map((member,i) =>(
                   <p key = {i}>{member}</p>
                ))
            )}
        </div>
    )
}

export default Workers
